import React from 'react'
import rsLogo from '../assets/rs_school_js.svg'
import gitLogo from '../assets/gitHub.png'

export const Footer = () => {
    return (
        <footer>
            <div>
                <img className='footer-rs-logo' src={rsLogo} alt=""/>
                <img className='footer-gitHub-logo' src={gitLogo} alt=""/>
            </div>
        </footer>
    )
}
